import "./ExpenselItem.css";
import Expendelitem from "./Expenselitem.js";
function Expense(data){
  console.log(data);
  return(
    <div className='app'>
      <Expendelitem 
        title={data[0].title} 
         amount={data[0].amount} 
         data={data[0].data}></Expendelitem>
    
   </div>


  )
}
export default Expense;
